import React from 'react';

import {MDBContainer, MDBView, MDBMask, MDBRow, MDBCol} from 'mdbreact';


class Build extends React.Component {
  
  render() {
    
    return (
      <div id="build">
        
          <MDBContainer
            style={{ height: '100%', width: '100%', paddingTop: '1rem' }}
            className="blue-grey-text"
          >
                    <h1 className='text-center'>
                    Build your dream website today
                    </h1>
                    <p className="text-center">But nothing the copy said could convince her and so it didnâ€™t take long until a few insidious Copy Writers ambushed her.</p>
             
          </MDBContainer>
          <MDBView>
          <MDBMask className='white-text gradient' />
          <MDBContainer
            style={{ height: '100%', width: '100%', paddingTop: '10rem' }}
            className='d-flex justify-content-center white-text align-items-center'
          >
            <MDBRow>
              <MDBCol md='6' className='text-center text-md-left mt-xl-5 mb-5'>
                
              </MDBCol>

              <MDBCol md='6' xl='5' className='mt-xl-5'>
                
              </MDBCol>
            </MDBRow>
          </MDBContainer>
        </MDBView>
        

      </div>
    );
  }
}

export default Build;
